  input: '"TEXT","F3A","C00178418","In response to a letter dated March 22, 2007 from
    Ms. Leah Palmer, Senior Campaign Finance Analyst, concerning aggregate election
    cycle-to-date totals for contributions from EchoStar  PAC, we have discussed this
    matter with the analyst and determined that the cycle-to -date total on the orginial
    report was correct.      Also, we have demostrated a best effort attempt to obtain
    employer and occupation information from all contributors making contribution
    in excess of $200.  The steps that this committee has taken are as follows:  First,
    at the time of the orginial solitication a request card is enclosed asking each
    contributor for the needed information.  This card states the reason for the information
    citing the federal statue.  If the needed information is not received then a series
    of telephone calls are made to the contributors as a stand alone effort.  These
    calls are made within 15 days of the contribution.  Finally, if the series of
    telephone calls are not successful, then a letter is sent to the individual.  This
    letter clearly ask for the missing information without soliciting an additional
    contribution."'
